import React, { useEffect, useState } from "react";
import "./apiCss.css";

const ApiPage = () => {
    const [users, setUsers] = useState([]);

    const fetchUserData = () => {
        fetch("https://api.coincap.io/v2/assets")
            .then(response => response.json())
            .then(data => {
                setUsers(data.data); // Update here to set 'data.data' to the 'users' state
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    };

    useEffect(() => {
        fetchUserData();
    }, []);

    return (
        <div className="features">
            {users.length > 0 && (
                <table>
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Price (USD)</th>
                        </tr>
                    </thead>
                    <tbody>
                        {users.map(user => (
                            <tr key={user.id}>
                                <td>{user.name}</td>
                                <td>{user.priceUsd}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
}

export default ApiPage;
